import './App.css';
import {Route,Routes} from 'react-router-dom';
import LobbyScreen from './Screens/Lobby';
import RoomPage from './Screens/Rooms';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<LobbyScreen />}/>
        <Route path="/room/:roomId" element={<RoomPage/>}/>
      </Routes>
    </div>
  );
}

export default App;
